import React from 'react';
import './App.css';

class App extends React.Component {

  constructor(props) {
    super(props);
    this.state = {
      title: 'Pieter Bikkel',
      headerLinks: [
        {title: 'Home', path: '/'},
        {title: 'About', path: '/about'},
        {title: 'Contact', path: '/contact'}
      ],
      home: {
        title: 'Developing Apps',
        subTitle: 'Apps that make a difference',
        text: 'Check out my apps below' 
      }
    }
  }
  render() {
    return (
      <div>Hello from Reacy</div>
      );
  }
}

export default App;
